-- 自動的にアルゴリズムIDを取得してその後のノード登録にも使えるやつ

DECLARE
    v_algorithm_id NUMBER; -- 取得したALGORITHM_IDを格納する変数
BEGIN
    -- ALGORITHM テーブルへの登録
    INSERT INTO ALGORITHM (USER_ID, STAGE_ID)
    VALUES (1, '10011') -- ユーザーID 1、ステージID '10011'
    RETURNING ALGORITHM_ID INTO v_algorithm_id; -- 自動生成されたIDを取得

    -- NODE テーブルへのノード登録
    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (1, 1, v_algorithm_id); -- ノード1: 前進

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (2, 3, v_algorithm_id); -- ノード2: ジャンプ

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (3, 2, v_algorithm_id); -- ノード3: 後退

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (4, 4, v_algorithm_id); -- ノード4: 右折

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (5, 5, v_algorithm_id);

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (6, 7, v_algorithm_id);

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (7, 8, v_algorithm_id);

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (8, 6, v_algorithm_id);

    INSERT INTO NODE (SEQUENCE_NUMBER, NODE_TYPE_ID, ALGORITHM_ID)
    VALUES (9, 6, v_algorithm_id);

    -- STAGE_CLEAR_HISTORY テーブルへの登録
    INSERT INTO STAGE_CLEAR_HISTORY (USER_ID, STAGE_ID, ALGORITHM_ID, CLEAR_TIME)
    VALUES (1, '13031', v_algorithm_id, 999); -- クリアタイム 999秒
END;

--  逆に登録したアルゴリズムを順番に取り出すSQL
SELECT 
    N.SEQUENCE_NUMBER, 
    NT.NODE_NAME
FROM 
    NODE N
JOIN 
    NODE_TYPE NT ON N.NODE_TYPE_ID = NT.NODE_TYPE_ID
WHERE 
    N.ALGORITHM_ID = (
        SELECT MAX(ALGORITHM_ID) 
        FROM ALGORITHM 
        WHERE USER_ID = 25 AND STAGE_ID = '13031'
    )
ORDER BY 
    N.SEQUENCE_NUMBER ASC;

